/// This is the main method of app, from here execution starts.
void main() => runApp(App());

/// App widget class.
class App extends StatefulWidget {
  App({Key? key}) : super(key: key);

  @override
  _AppState createState() => _AppState();
}

class _AppState extends State<App> {
  final pages = [
    PageViewModel(
      pageColor: kPutihColor,
      mainImage: XDBg1(),
      iconColor: kBiruColor,
      title: Text('Membaca'),
      titleTextStyle: kJudulStyle,
      body: Text(
          'Salah satu cara terbaik untuk meningkatkan kemampuan dan pengetahuan manusia.'),
      bodyTextStyle: kBodyBoldStyle,
      bubbleBackgroundColor: kBiruColor,
    ),
    PageViewModel(
      pageColor: kPutihColor,
      mainImage: XDBg2(),
      iconColor: kHijuToskaColor,
      title: Text('Teknologi'),
      titleTextStyle: kJudulStyle,
      body: Text(
          'Manfaatkan teknologi dalam hal kebaikan, seperti halnya belajar menggunakan HP. '),
      bodyTextStyle: kBodyBoldStyle,
      bubbleBackgroundColor: kHijuToskaColor,
    ),
    PageViewModel(
      pageColor: kPutihColor,
      mainImage: XDBg3(),
      iconColor: kMerahColor,
      title: Text('Kesehatan'),
      titleTextStyle: kJudulStyle,
      body:
          Text('Tetap patuhi protokol kesehatan. Kesehatan adalah yang utama.'),
      bodyTextStyle: kBodyBoldStyle,
      bubbleBackgroundColor: kMerahColor,
    ),
  ];

  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      debugShowCheckedModeBanner: false,
      title: 'IntroViews Flutter',
      theme: ThemeData(
        primarySwatch: Colors.blue,
      ),
      home: Builder(
          builder: (context) => IntroViewsFlutter(
                pages,
                showBackButton: false,
                onTapDoneButton: () {
                  // Use Navigator.pushReplacement if you want to dispose the latest route
                  // so the user will not be able to slide back to the Intro Views.
                  Navigator.pushReplacement(
                    context,
                    MaterialPageRoute(builder: (_) => HomePage()),
                  );
                },
                pageButtonTextStyles: kBodyBoldStyle,
                fullTransition: 250.0,
                columnMainAxisAlignment: MainAxisAlignment.end,
                showSkipButton: true,
                showNextButton: false,
                // doneButtonPersist: true,
                skipText: Padding(
                  padding: const EdgeInsets.only(left: 16),
                  child: Container(
                    child: Text('Skip',
                        style: TextStyle(
                          fontFamily: 'Adobe Clean',
                          fontWeight: FontWeight.bold,
                          fontSize: 19,
                          color: kAbuTerangColor,
                        )),
                  ),
                ),
                doneText: Padding(
                  padding: const EdgeInsets.only(right: 16),
                  child: Container(
                    child: Text('Lanjut',
                        style: TextStyle(
                          fontFamily: 'Adobe Clean',
                          fontWeight: FontWeight.bold,
                          fontSize: 19,
                          color: kAbuGelapColor,
                        )),
                  ),
                ),
              )),
    );
  }
}

/// Home Page of our example app.
class HomePage extends StatelessWidget {
  // ignore: prefer_const_constructors_in_immutables
  HomePage({Key? key}) : super(key: key);

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text('Home'),
      ),
      body: const Center(
        child: Text('This is the home page of the app'),
      ),
    );
  }
}

